public class InnerDataProviderSettingsFactory(Action<Humidifier.DMS.DataProviderTypes.Settings> factoryAction = null) : SubResourceFactory<Humidifier.DMS.DataProviderTypes.Settings>
{

    internal InnerDataProviderOracleSettingsFactory OracleSettingsFactory { get; set; }

    internal InnerDataProviderMicrosoftSqlServerSettingsFactory MicrosoftSqlServerSettingsFactory { get; set; }

    internal InnerDataProviderMySqlSettingsFactory MySqlSettingsFactory { get; set; }

    internal InnerDataProviderPostgreSqlSettingsFactory PostgreSqlSettingsFactory { get; set; }

    protected override Humidifier.DMS.DataProviderTypes.Settings Create()
    {
        var settingsResult = CreateSettings();
        factoryAction?.Invoke(settingsResult);

        return settingsResult;
    }

    private Humidifier.DMS.DataProviderTypes.Settings CreateSettings()
    {
        var settingsResult = new Humidifier.DMS.DataProviderTypes.Settings();

        return settingsResult;
    }
    public override void CreateChildren(Humidifier.DMS.DataProviderTypes.Settings result)
    {
        base.CreateChildren(result);

        result.OracleSettings ??= OracleSettingsFactory?.Build();
        result.MicrosoftSqlServerSettings ??= MicrosoftSqlServerSettingsFactory?.Build();
        result.MySqlSettings ??= MySqlSettingsFactory?.Build();
        result.PostgreSqlSettings ??= PostgreSqlSettingsFactory?.Build();
    }

} // End Of Class

